import logo from './images/ball.png';
import React, { Component } from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Home from './Home.js';
import 'bootstrap/dist/css/bootstrap.css';
import './App.css';

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar style={{background: '#4B2E83'}} expand="lg" fixed='top'>
          <Link to="/">
            <img width='50' height='50' src={logo}></img>
            <Navbar.Brand style={{fontSize: '30px', marginLeft: '20px', marginBottom: '0', fontWeight: 'bold', color: '#D7BE69'}}>FanCentral</Navbar.Brand>
          </Link>
          <Nav className="mr-auto">
            <Nav.Link style={{fontSize: '30px', color: '#D7BE69', float: 'right'}} className='mr-sm-2'>Aryan</Nav.Link>
          </Nav>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
          </Navbar.Collapse>
        </Navbar>
        <Switch>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
